import React from "react";
import foodTypes from "../foodTypeData2"

const MenuFood = () => {
  console.log(foodTypes);
  return (
    <div className="menu-food">
      <h3>Choose an ingredient / prep method.</h3>
      <ul>
      {Object.keys(foodTypes).map((type, index1) => {
        Object.keys(type).map((subtype, index2) => {
          return <li>{subtype}</li>
        })


      })}
      </ul>
    </div>
  );
};

export default MenuFood;
